var game;
var gameLoaded = false;
var createOnLoaded = false;

window.onload = function () {
    var gameConfig = {
        type: Phaser.AUTO,
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],
            addFlag = false;

        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }

        var letters = {
            level1: {
                letter_c: ['a', 'b', 'c', 'd', 'f'],
                letter_s: ['a1', 'b1', 'c1', 'd1'],
                answer: 'abcd',
                prompt:['a','b','c'],
                box: 'box',
                plate: {
                    key: 'words',
                    x: 256,
                    y: 600,
                    width: 426,
                    height: 334
                },
                flag:false
            }
        }
        this.clickWord('level1', letters)
        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    clickWord(levelName, jsonName) {
        var level
        var letter_name = [],
            letter_name1 = []
        var letter_c1 = [],
            letter_c2 = []
        var result  = []
        var boxName = []
        var showLetterName = []
        for (var key in jsonName) {
            if (levelName == key) {
                level = jsonName[key]
                var plate = this.add.image(jsonName[key].plate.x, jsonName[key].plate.y, jsonName[key].plate.key).setScale(1.05, 1)

            }
        }

        for (let i = 0; i < level.prompt.length; i++) {
            result.push(level.prompt[i])
        }
        
        for (let i = 0; i < level.answer.length; i++) {
            boxName[i] = this.add.image(level.plate.x + (i - (level.answer.length - 1) / 2) * 50, level.plate.y-100, level.box).setScale(0.8, 0.8)
        }

        if(result.length>0){
            for (let i = 0; i < result.length; i++) {
                showLetterName[i] = this.add.image(boxName[i].x,boxName[i].y,result[i]+'1').setScale(0.8,0.8)
            }
        }

        var this_ = this

        //找寻名字数组分割数组,排列按钮
        if (level.letter_c.length % 2 === 0) {
            letter_c1 = level.letter_c.slice(0, level.letter_c.length / 2)
            letter_c2 = level.letter_c.slice(level.letter_c.length / 2, level.letter_c.length)
            console.log(letter_c2)
        } else {
            level.letter_c.push('a')
            letter_c1 = level.letter_c.slice(0, level.letter_c.length / 2)
            letter_c2 = level.letter_c.slice(level.letter_c.length / 2, level.letter_c.length)
        }
        for (let i = 0; i < letter_c1.length; i++) {
            letter_name1.push(this.add.image(level.plate.x + (i - (letter_c1.length - 1) / 2) * 90, level.plate.y, letter_c1[i] + letter_c1[i]))
            letter_name.push(this.add.image(level.plate.x + (i - (letter_c1.length - 1) / 2) * 90, level.plate.y, letter_c1[i]).setInteractive())
        }
        for (let i = 0; i < letter_c2.length; i++) {
            letter_name1.push(this.add.image(level.plate.x + (i - (letter_c2.length - 1) / 2) * 90, level.plate.y+90, letter_c2[i] + letter_c2[i]))
            letter_name.push(this.add.image(level.plate.x + (i - (letter_c2.length - 1) / 2) * 90, level.plate.y+90, letter_c2[i]).setInteractive())
        }
        for (let i = 0; i < letter_name.length; i++) {
            letter_name[i].on('pointerdown', function () {
                this.visible = 0
                result.push(this.texture.key)
                // console.log(result)
                showLetterName.push(this_.add.image(boxName[result.length-1].x,boxName[result.length-1].y,result[result.length-1]+'1').setScale(0.8,0.8))
                if(result.length == level.answer.length){
                    if (result.join('') == level.answer) {
                        for (let i = 0; i < showLetterName.length; i++) {
                            showLetterName[i].setTint(0x00FF00)
                            var item = showLetterName[i]
                            this_.tweens.add({
                                targets:[item],
                                alpha:0,
                                delay:50,
                                duration:50
                            })
                            this_.tweens.add({
                                targets:[item],
                                alpha:1,
                                delay:100,
                                duration:50
                            })
                            this_.tweens.add({
                                targets:[item],
                                alpha:0,
                                delay:150,
                                duration:50
                            })
                            this_.tweens.add({
                                targets:[item],
                                alpha:1,
                                delay:200,
                                duration:50,
                                onComplate:()=>{
                                    if(item == showLetterName[showLetterName.length-1]){
                                        this_.tweens.add({
                                            targets:[plate],
                                            alpha:0,
                                            scaleX:0,
                                            scaleY:0,
                                            duration:200
                                        })
                                        for (let i = 0; i < letter_name.length; i++) {
                                            var item2 = letter_name[i]
                                            var item3 = letter_name1[i]
                                            this_.tweens.add({
                                                targets:[item2,item3],
                                                x:level.plate.x,
                                                y:level.plate.y,
                                                scaleX:0,
                                                scaleY:0,
                                                alpha:0,
                                                duration:200
                                            })                                           
                                        }
                                        for (let i = 0; i < boxName.length; i++) {
                                            var box = boxName[i]
                                            var showletter = showLetterName[i]
                                            this_.tweens.add({
                                                targets:[box,showletter],
                                                x:level.plate.x,
                                                y:level.plate.y,
                                                scaleX:0,
                                                scaleY:0,
                                                alpha:0,
                                                duration:200,
                                                onComplate:()=>{
                                                    level.flag = true
                                                }
                                            })
                                        }
                                    }
                                }
                            })
                        }

                    }else{
                        for (let i = 0; i < showLetterName.length; i++) {
                            showLetterName[i].setTint(0xed1941)
                            var item = showLetterName[i]
                            this_.tweens.add({
                                targets:[item],
                                alpha:0,
                                delay:50,
                                duration:50
                            })
                            this_.tweens.add({
                                targets:[item],
                                alpha:1,
                                delay:100,
                                duration:50
                            })
                            this_.tweens.add({
                                targets:[item],
                                alpha:0,
                                delay:150,
                                duration:50
                            })
                            this_.tweens.add({
                                targets:[item],
                                alpha:1,
                                delay:200,
                                duration:50,
                                onComplate:()=>{
                                    if(item == showLetterName[showLetterName.length-1]){
                                        for (let i = 0; i < letter_name.length; i++) {
                                            letter_name[i].visible = 1                            
                                        }
                                        for (let i = 0; i < showLetterName.length; i++) {
                                            showLetterName[i].destroy()
                                            if(i == showLetterName.length-1){
                                                showLetterName = []
                                                result = []
                                            }                            
                                        }
                                        for (let i = 0; i < level.prompt.length; i++) {
                                            result.push(level.prompt[i])
                                        }
                                        if(result.length>0){
                                            for (let i = 0; i < result.length; i++) {
                                                showLetterName[i] = this_.add.image(boxName[i].x,boxName[i].y,result[i]+'1').setScale(0.8,0.8)
                                            }
                                        }
                                    }
                                }
                            })
                        }
                    }
                }
            })
        }
    }


    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
}

